import React, { FunctionComponent } from "react";
import _ from 'lodash';
import { Grid, Button, Typography, Hidden } from "@material-ui/core";
import Banner from "./Banner";
import Introduce from "./Introduce";
import Benefit from "./Benefit";
import AboutUs from "./AboutUs";
import { introduceInfo, infoTitle, priceListTitle, priceListContent, indexStyles } from "./Constants";
import { makeStyles } from "@material-ui/core/styles";

const Index: FunctionComponent = () => {
  const classes = indexStyles();
  return (
    <div>
      <Banner/>
      <div className={classes.root} >
        <Grid container spacing={0}>
          <Grid item xs={12} sm={12} md={1} lg={2}></Grid>
          <Grid item xs={12} sm={12} md={10} lg={8}>
            <div className={classes.introInfo} >
              {introduceInfo}
            </div>
            <div className={classes.infoTitle}>
              {infoTitle}
            </div>
          </Grid>
          <Grid item xs={12} sm={12} md={1} lg={2} ></Grid>
        </Grid>  
        <Introduce/>
        <Benefit />
        <Typography className={classes.priceTitle}>
          {priceListTitle}
        </Typography>
        <Typography className={classes.priceContent}>
          {priceListContent}
        </Typography>
        <Typography className={classes.priceDetail}>
          Hiển thị chi tiết
        </Typography> 
      </div>
      <AboutUs/> 
    </div>
  );
};

export default Index;
